from gmpy2 import is_prime
from itertools import count, islice
def f(m):
    t = (1<<m) - 1
    return sum(1 for k in range(1, m) if is_prime(t-(1<<k)))
def agen(): # generator of terms
    adict, n = dict(), 0
    for k in count(1):
        v = f(k)
        if v not in adict:
            adict[v] = k
            while n in adict: yield adict[n]; n += 1
print(list(islice(agen(), 16))) # _Michael S. Branicky_, Sep 08 2025

